import React from 'react'

class Home extends React.Component {
    render(){
        return(

              <div className="container-fluid">
                  <div className="row">
                      <div className="col-sm-7">
                          <div className="row" align="center">
                              <div className="col-sm-12" style={{border:'1px solid rgb(49, 116, 240)', backgroundColor:'black', color:'rgb(49, 116, 240)'}}>
                                  <h4>What is it!</h4>
                                A place to make notes and search dictionary while you listen to an audiobook.
                                Search for the audiobook you want to consume and click on it(of course!), there it is! 
                              </div>
                          </div>
                      </div>
                      <div className="col-sm-5"></div>
                  </div>
              </div>

        )
    }

}
export default Home;
